//UTILES
import { BrowserRouter, Route, Routes } from "react-router-dom";
//PAGES
import Home from "./pages/Home.js";
import SpaceCraft from "./pages/SpaceCraft.js";
import Planets from "./pages/Planets.js";
//STYLE
import "bootstrap/dist/css/bootstrap.min.css";
import "./styles/App.css";
import ShipBuilder from "./pages/ShipBuilder.js";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/SpaceCraft" element={<SpaceCraft />} />
          <Route path="/Planets" element={<Planets />} />
          <Route
            path="/*"
            element={
              <h1 style={{ margin: "auto", textAlign: "center" }}>404 ERROR</h1>
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
